import React, { Component } from 'react';
import './CompareCompany.css';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import {Row,Col,Button,Form} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';
import {Link} from 'react-router-dom';
import {
    withRouter
  } from 'react-router-dom';

class CompareCompany extends Component{
    constructor(props){
        super(props);
        this.state = {
            data : []
        }
        this.generateMap = this.generateMap.bind(this);
    }

    componentDidMount(){
        console.log("token" + this.props.getAuthToken());
        var requestOptions = {
            method : 'GET',
            headers : {"Authorization" : "Bearer " + this.props.getAuthToken() }
        }
        fetch("http://localhost:8082/company/getCompanies",requestOptions)
        .then(response =>  response.json())
        .then(data => {
            this.setState({data : data});
        })
    }

    generateMap(){
        
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDownUser />
                <br></br>
                <br></br>
                <br></br>
                <div id="compare-main-div">
                <Card className="text-center" id="text-header-cc">
                <Card.Header>{this.props.type}</Card.Header>
                <Card.Body>
                    
                    <Form onSubmit={this.generateMap}>
                        <Form.Group>
                            <Form.Label>Select a Company</Form.Label>
                            <select name="company" id="company">
                                <option value="a">a</option>
                                <option value="b"></option>
                            </select>
                        </Form.Group>

                        <Form.Group>
                            <Form.Label>Password</Form.Label>
                            <Form.Control id="password" type="password" placeholder="Password" required />
                        </Form.Group>
 
                        
                        <Button variant="primary" type="submit">
                            {this.props.type}
                        </Button>
                        
                    </Form>
                       
                </Card.Body>
            
                </Card>
                </div>
            </React.Fragment>
            
        );
    }
}

export default CompareCompany;
